import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import { AuthProvider, useAuth } from "./context/AuthContext";

import Home from "./pages/Home";
import Start from "./pages/Start";
import Register from "./pages/Register";
import Login from "./pages/Login";
import Jobs from "./pages/Jobs";
import JobDetails from "./pages/JobDetails";
import Gigs from "./pages/Gigs";
import Upskill from "./pages/Upskill";
import NotFound from "./pages/NotFound";
import GetStarted from "./pages/GetStarted";

// Student
import StudentDashboard from "./pages/Dashboard/StudentDashboard";
import StudentProfile from "./pages/Profile/StudentProfile";
import Applications from "./pages/student/Applications";

// Employer
import EmployerDashboard from "./pages/Dashboard/EmployerDashboard.jsx";
import EmployerProfile from "./pages/Profile/EmployerProfile.jsx";
import EmployerJobs from "./pages/employer/MyJobs.jsx";
import PostJob from "./pages/employer/PostJob.jsx";
import EditJob from "./pages/employer/EditJob.jsx";
import EmployerGigs from "./pages/employer/EmployerGigs.jsx";
import PostGig from "./pages/employer/PostGig.jsx";

// Admin (optional)
import AdminDashboard from "./pages/AdminDashboard";

// ---- Route guards ----
function ProtectedRoute({ children, role }) {
  const { user } = useAuth();
  if (!user) return <Navigate to="/start" replace />;
  if (role && user.role !== role) return <Navigate to="/" replace />;
  return children;
}

export default function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          {/* Public routes */}
          <Route path="/" element={<Home />} />
          <Route path="/start" element={<Start />} />
          <Route path="/register" element={<Register />} />
          <Route path="/login" element={<Login />} />
          <Route path="/get-started" element={<GetStarted />} />

          {/* Student routes */}
          <Route path="/tech-nect2/src/pages/Dashboard/StudentDashboard.jsx" element={
            <ProtectedRoute role="student"><StudentDashboard /></ProtectedRoute>
          } />
          <Route path="/tech-nect2/src/pages/Profile/StudentProfile.jsx" element={
            <ProtectedRoute role="student"><StudentProfile /></ProtectedRoute>
          } />
          <Route path="/tech-nect2/src/pages/Applications.jsx" element={
            <ProtectedRoute role="student"><Applications /></ProtectedRoute>
          } />

          {/* Employer routes */}
          <Route path="/tech-nect2/src/pages/Dashboard/EmployerDashboard.jsx" element={
            <ProtectedRoute role="employer"><EmployerDashboard /></ProtectedRoute>
          } />
          <Route path="/tech-nect2/src/pages/Profile/EmployerProfile.jsx" element={
            <ProtectedRoute role="employer"><EmployerProfile /></ProtectedRoute>
          } />
          <Route path="/tech-nect2/src/pages/employer/EmployerJobs.jsx" element={
            <ProtectedRoute role="employer"><EmployerJobs /></ProtectedRoute>
          } />
          <Route path="/tech-nect2/src/pages/employer/PostJob.jsx" element={
            <ProtectedRoute role="employer"><PostJob /></ProtectedRoute>
          } />
          <Route path="/tech-nect2/src/pages/employer/EditJob.jsx" element={
            <ProtectedRoute role="employer"><EditJob /></ProtectedRoute>
          } />
          <Route path="/tech-nect2/src/pages/employer/EmployerGigs.jsx" element={
            <ProtectedRoute role="employer"><EmployerGigs /></ProtectedRoute>
          } />
          <Route path="/tech-nect2/src/pages/employer/PostGig.jsx" element={
            <ProtectedRoute role="employer"><PostGig /></ProtectedRoute>
          } />

          {/* Shared protected routes */}
          <Route path="/tech-nect2/src/pages/Jobs.jsx" element={
            <ProtectedRoute><Jobs /></ProtectedRoute>
          } />
          <Route path="/tech-nect2/src/pages/JobDetails.jsx" element={
            <ProtectedRoute><JobDetails /></ProtectedRoute>
          } />
          <Route path="/tech-nect2/src/pages/Gigs.jsx" element={
            <ProtectedRoute><Gigs /></ProtectedRoute>
          } />
          <Route path="/tech-nect2/src/pages/Upskill.jsx" element={
            <ProtectedRoute><Upskill /></ProtectedRoute>
          } />

          {/* Admin dashboard */}
          <Route path="/admin" element={
            <ProtectedRoute role="admin"><AdminDashboard /></ProtectedRoute>
          } />

          {/* 404 */}
          <Route path="*" element={<NotFound />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}
